const DisplayData = ({ data }) => {
  if (Array.isArray(data)) {
    // If data is an array, map through the users
    return (
      <div>
        <h2>Submitted Data</h2>
        <table>
          <thead>
            <tr>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Mobile Number</th>
              <th>Email</th>
              <th>Location</th>
              <th>Blood Group</th>
            </tr>
          </thead>
          <tbody>
            {data.map((user, index) => (
              <tr key={index}>
                <td>{user.firstName}</td>
                <td>{user.lastName}</td>
                <td>{user.mobileNumber}</td>
                <td>{user.email}</td>
                <td>{user.location}</td>
                <td>{user.bloodGroup}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  } else if (typeof data === "object" && data !== null) {
    // If data is an object, display it
    return (
      <div>
        <h2>Submitted Data</h2>
        <table>
          <thead>
            <tr>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Mobile Number</th>
              <th>Email</th>
              <th>Location</th>
              <th>Blood Group</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>{data.firstName}</td>
              <td>{data.lastName}</td>
              <td>{data.mobileNumber}</td>
              <td>{data.email}</td>
              <td>{data.location}</td>
              <td>{data.bloodGroup}</td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  } else {
    return <div>No valid data available</div>;
  }
};
